import React, {useState} from 'react';
import "../css/NurDailyPrescription.css";
const PrescModal = () =>{
    const [isChecked, setIsChecked] = useState(false);
    const handleClick=()=>{
        setIsChecked(!isChecked);
    }
    return(
        <div className="PrescModalbox">
            <br/>
            <div className="boxHeader">
                <h3 id="boxHeader" style={{margin:"0 auto"}}>처방 상태 변경</h3>
            </div>
            <br/>
            <div className="prescContent">
            <label><p id="prescSelectText">투약</p>
                        <input className={isChecked ? 'radio-checked':''} type="radio" id="presX" style={{width:"140px"}} onClick={handleClick}/></label>
                        <br/>
                        <label > <p id="prescSelectText">미투약</p>
                            <input type="radio" id="presO"  style={{width:"140px"}}/></label><br/>
                            <label>
                            <p id="prescSelectText">투약 X - 반환 가능</p>
                            <input type="radio" id="presXV"  style={{width:"140px"}}/></label><br/>
                            <label>
                            <p id="prescSelectText">투약 X - 반환 불가</p>
                            <input type="radio" id="presXVX"  style={{width:"140px"}}/>
                            </label>
                            </div>

                            <button id="button1" style={{margin:"0"}}>저장</button>
                </div>
    )
}

export default PrescModal;
